		function timerfunc() {
		
			stage.getChildByName("timer").time.text = timerseconds;
			timerseconds--;
			questime++;
			if (timerseconds < 9) {
				stage.getChildByName("timer").time.x = -5;
			} else {
				stage.getChildByName("timer").time.x = -9;
			}
			if (timerseconds == 0) {
				istimeover = true;
				to = 1;
				stage.removeChild(stage.getChildByName("timer"));
				soundbtn.visible = false;
				unsoundbtn.visible = false;
				pausebtn.visible = false;
				clearInterval(timerinterval);
				var timeover = new lib.timeover();
				timeover.name = "timeover";
				stage.addChild(timeover);
				stage.getChildByName("timeover").tocontiniuebtn.addEventListener("click", nextq);
				stage.getChildByName("timeover").x += 200;
				stage.getChildByName("timeover").y += 15;
				stage.getChildByName("pausebtn").visible = false;
				stage.removeChild(stage.getChildByName("nextbtn"));
				stage.removeChild(stage.getChildByName("checkbtn"));
			}
		
		}
		
		
		
